import React from 'react'
import { useNavigate } from 'react-router-dom';
import './NavigationBar.css';
const NavigationBar = () => {
    const navigate = useNavigate();
  const handleGetStarted = () => {
    navigate("/register");
  };
  const handleLoginOnLanding=()=>{
    navigate("/login")
  };
  return (
    <div className='nav'>
        <nav className="navbar">
        {/* Left links */}
        <ul className="nav-left">
          <div className="logo">Advanced To Do</div>
          <li className="active">HOME</li>
          <li onClick={handleDasboard}>DASHBOARD</li>
          <li>USERS</li>
          <li>TASKS</li>
        </ul>

        {/* Right buttons */}
        <div className="nav-right">
          <button className="loginn-btn" onClick={handleLoginOnLanding}>LOGIN</button>
          <button className="signup-btn" onClick={handleGetStarted}>SIGNUP</button>
        </div>
      </nav>
      
    </div>
  )
}

export default NavigationBar
